import React from "react";
import { Route, Link, Switch } from 'react-router-dom'
import Home from './Home'
import './App.css'

const App = () => {
  return (
    <div className='App'>
      <nav>
      <h1 className='store-header' >AgbPizza</h1>
      </nav>
    <Switch>
      <Route exact path='/'>
        <Home/>
      </Route>
    </Switch>
    </div>
  );
};
export default App;
